loadEnv(__DIR__ . '/.env');

function checkCabinType($cabinType){
    $cabinArray = ['Y' => 'Economy', 'S' => 'Premium Economy', 'C' => 'Business', 'F' => 'First Class'];
    if(array_key_exists($cabinType, $cabinArray)){
        return $cabinArray[$cabinType];
    } else {
        return 'Economy'; // Default to Economy if not found
    }
}

function getFlightSearchResult($departure_from, $arrival_to, $departure_date, $return_date, $adults, $children, $cabin_class, $trip_type){
    // ✅ Build PassengerList dynamically
    $passengerList = [];

    $counter = 1;

    // Add Adults
    for ($i = 1; $i <= $adults; $i++) {
        $passengerList[] = [
            "PassengerID" => "T" . $counter,
            "PTC"         => "ADT"
        ];
        $counter++;
    }

    // Add Children
    for ($i = 1; $i <= $children; $i++) {
        $passengerList[] = [
            "PassengerID" => "T" . $counter,
            "PTC"         => "CHD"
        ];
        $counter++;
    }

    // ✅ Prepare OriginDestination
    if($trip_type === 'ONEWAY') {
        $originDestination = [
            "OriginDestinations" => [
                "OriginDestination" => [
                    [
                        "Departure" => [
                            "AirportCode" => $departure_from,
                            "Date"        => $departure_date
                        ],
                        "Arrival" => [
                            "AirportCode" => $arrival_to
                        ]
                    ]
                ]
            ]
        ];
    }

    // ✅ Add return leg if roundtrip
    if ($trip_type === 'ROUND') {
        $originDestination = [
            "OriginDestinations" => [
                "OriginDestination" => [
                    [
                        "Departure" => [
                            "AirportCode" => $departure_from,
                            "Date"        => $departure_date,
                            "ArrivalTime" => new stdClass() // empty object {}
                        ],
                        "Arrival" => [
                            "AirportCode" => $arrival_to
                        ]
                    ],
                    [
                        "Departure" => [
                            "AirportCode" => $arrival_to,
                            "Date"        => $return_date,
                            "ArrivalTime" => new stdClass()
                        ],
                        "Arrival" => [
                            "AirportCode" => $departure_from
                        ]
                    ]
                ]
            ]
        ];
    }

    // ✅ Final Body
    $body = [
        "AirShoppingRQ" => [
            "CoreQuery" => $originDestination,
            "DataLists" => [
                "PassengerList" => [
                    "Passenger" => $passengerList
                ]
            ],
            "Preference" => [
                "TripType"   => ucfirst($trip_type), // Oneway / Roundtrip
                "CabinType"  => strtoupper(substr($cabin_class, 0, 1)), // Y, C, F
                "FareType"   => ["70J","749"], // example, depends on API
                "Currency"   => "CAD"
            ]
        ]
    ];

    $response = callApi('AirShopping', $body);

    return json_decode($response, true);
}

function callApi($endpoint, $body){
    $url = getenv('API_BASE_URL') . $endpoint;
    $headers = [
        'Content-Type: application/json',
        'Authorization: ' . getenv('API_KEY')
    ];

    $data = json_encode($body);

    $ch = curl_init();
    curl_setopt($ch, CURLOPT_URL, $url);
    curl_setopt($ch, CURLOPT_HTTPHEADER, $headers);
    curl_setopt($ch, CURLOPT_POSTFIELDS, $data);
    curl_setopt($ch, CURLOPT_RETURNTRANSFER, true);
    $response = curl_exec($ch);
    curl_close($ch);

    return $response;
}

function getOfferDetails($shoppingResponseID, $offerID, $adults, $children, $cabinClass, $tripType){
    // Build dynamic passenger list
    $passengers = [];
    $paxIndex = 1;

    for ($i = 1; $i <= $adults; $i++) {
        $passengers[] = [
            'PassengerID' => 'T' . $paxIndex++,
            'PTC' => 'ADT',
        ];
    }

    for ($i = 1; $i <= $children; $i++) {
        $passengers[] = [
            'PassengerID' => 'T' . $paxIndex++,
            'PTC' => 'CHD',
        ];
    }

    // Build final body
    $body = [
        'OfferPriceRQ' => [
            'ShoppingResponseId' => $shoppingResponseID,
            'Query' => [
                'Offer' => [
                    'OfferID' => $offerID,
                ],
            ],
            'DataLists' => [
                'PassengerList' => [
                    'Passenger' => $passengers,
                ],
            ]
        ],
    ];

    $response = callApi('AirOfferPrice', $body);

    return json_decode($response, true);
}

